const INITIAL_STATE={
  id: 0,
  totalIncome: 0,
  saving: 0,
  expenses: []
}




export default function(state= INITIAL_STATE , action){
  switch(action.type){

    case 'EXPENSES':
        return action.payload

    case 'CALCULATOR':
      return action.payload

    default:
      return state
  }
}
